import React, { Component } from 'react';
import { connect } from 'react-redux';

import { Button } from 'react-bootstrap';
import Header, { HeaderLeft, HeaderCenter, HeaderLogo, HeaderRight } from '../../components/Dealer/Header';
import { IconHome } from '../../assets/images';

class HomeScreen extends Component {

    handleHomeClick = () => {
        this.props.history.replace('/')
    }

    handlePreApprovalsClick = () => {
        this.props.history.push('/admin/preapprovals');
    }

    handleRequestFundingsClick = () => {
        this.props.history.push('/admin/fundings');
    }

    render() {
        return (
            <div className="dealer">
                <Header isHome={true}>
                    <HeaderLeft>
                        <img src={IconHome} alt="home" style={{ width: 26, height: 36 }} onClick={this.handleHomeClick} />
                    </HeaderLeft>
                    <HeaderCenter>
                        <HeaderLogo />
                    </HeaderCenter>
                    <HeaderRight />
                </Header>
                <div style={{ display: 'flex', alignItems: 'center', justifyContent: 'center', flexDirection: 'column' }}>
                    <Button style={{ marginTop: 50, marginBottom: 30 }} onClick={this.handlePreApprovalsClick}>Manage Pre Approvals</Button>
                    <Button onClick={this.handleRequestFundingsClick}>Manage Request Fundings</Button>
                </div>
            </div>
        )
    }
}

